import React from 'react'
import { Login } from './Users/Login'
import { Register } from './Users/Register'

export const Homepageontent = () => {
    const [btnLogin, setBtnLogin] = useState(true);
  const toggleTab = () => {
    setBtnLogin(!btnLogin);
  };
  return (
    <>

<ul className="navbar-nav mr-auto mb-0 h3">  
      <li><Link to={'/Register'} className="nav-link" onClick={toggleTab}>Register</Link></li>
      <li><Link to={'/Login'} className="nav-link" onClick={toggleTab}>Login</Link></li>
      {/* <li><Link onClick={Custom} className="nav-link">Demo</Link></li> */}
      </ul>
      {btnLogin ? <LoginForm /> : <SignUpForm />}
    </>
  )
}
